import axios from 'axios';

import {Card, Nav, Col, Container, Navbar, Row, ListGroup} from 'react-bootstrap'
import { useState, useCallback, useEffect } from 'react';


function App() {
  const [rates, setRates] = useState([])
  const fetchAndGetRates = "http://localhost:8080/rates?usedb=true";
  const getRates = "http://localhost:8080/rates?usedb=false";
  const deleteAllRates = "http://localhost:8080/deleteAll";

  const processFetchAndGetRates = async(e) => {
    e.preventDefault();
    try {
      const resp = await axios({
        method: 'get',
        withCredentials: false,
        url: fetchAndGetRates,
        headers: {
          "Access-Control-Allow-Origin": "*"
        },
      });
      console.log(resp.data)
      setRates(resp.data)
    } catch (error) {
      console.log(error)
    }
  }

  const processGetRates = async(e) => {
    e.preventDefault();
    try {
      const resp = await axios({
        method: 'get',
        withCredentials: false,
        url: getRates,
        headers: {
          "Access-Control-Allow-Origin": "*"
        },
      });
      console.log(resp.data)
      setRates(resp.data)
    } catch (error) {
      console.log(error)
    }
  }

  useEffect(() => {
    processGetRates();    //  get list of rates after downloading
  });

  return (
    <>
      <Navbar bg='dark'>
        <Container>
          <Navbar.Brand>
            <div style={{color: "white"}}>Exchange Rates</div>
          </Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link onClick={processFetchAndGetRates}>fetch</Nav.Link>
            <Nav.Link href="#features">Features</Nav.Link>
            <Nav.Link href="#pricing">Pricing</Nav.Link>
          </Nav>
        </Container>
      </Navbar>

      <Row>
        <Col>
          <Container style={{width: "100%", height: "100%"}}>
            <ListGroup>
              {rates.map(rate => {
                return <ListGroup.Item key={rate.id} as="li">
                  Cras justo odio
                </ListGroup.Item>
              })}
            </ListGroup>
          </Container>
        </Col>
        <Col>

        </Col>
      </Row>
    </>
  );
}

export default App;
